aria-hidden><polygon points="2 6 12 18 22 6" /></svg></a></div><a class="avatar_container" href="https://itch.io/profile/fardboy"><div class="post_avatar" style="background-image: url(/static/images/frog-blue.png)"></div></a><div class="post_header"><span class="post_author"><a href="https://itch.io/profile/fardboy">fardboy</a></span><span class="post_date" title="2023-06-09 09:58:45"><a href="https://itch.io/post/7932940">21 days ago</a></span><span class="vote_counts"><span class="upvotes">(+1)</span></span></div><div class="post_content"><div class="post_body user_formatted" dir="auto"><p>pretty fun, codes get old after a while but it&#x27;s excusable. takes about 30ish minutes, maybe less depending on how fast you grasp the way to get each ending. overall, worth a shot.<del></del></p></div><div class="post_footer"><a data-register_action="community_reply" class="post_action reply_btn" href="https://itch.io/login?intent=community&amp;return_to=https%3A%2F%2Faislebsoupid.itch.io%2Fbonnies-bakery">Reply</a></div></div></div></div><div id="post-7931480" class="community_post has_vote_column" data-post="{&quot;id&quot;:7931480,&quot;user_id&quot;:3327938}"><div class="post_grid"><div class="post_votes"><a data-register_action="community_vote" href="https://itch.io/login?intent=community&amp;return_to=https%3A%2F%2Faislebsoupid.itch.io%2Fbonnies-bakery" title="Vote up" class="vote_up_btn vote_btn"><svg width="20" class="svgicon icon_vote_up" role="img" height="20" version="1.1" viewbox="0 0 24 24" aria-hidden><polygon points="2 18 12 6 22 18" /></svg></a> <a data-register_action="community_vote" href="https://itch.io/login?intent=community&amp;return_to=https%3A%2F%2Faislebsoupid.itch.io%2Fbonnies-bakery" title="Vote down" class="vote_down_btn vote_btn"><svg width="20" class="svgicon icon_vote_down" role="img" height="20" version="1.1" viewbox="0 0 24 24" aria-hidden><polygon points="2 6 12 18 22 6" /></svg></a></div><a class="avatar_container" href="https://itch.io/profile/pacmangamer"><div class="post_avatar" style="background-image: url(/static/images/frog-gold.png)"></div></a><div class="post_header"><span class="post_author"><a href="https://itch.io/profile/pacmangamer">pacmangamer</a></span><span class="post_date" title="2023-06-08 23:16:46"><a href="https://itch.io/post/7931480">21 days ago</a></span> <span class="edit_message">(1 edit)</span> <span class="vote_counts"><span class="upvotes">(+1)</span></span></div><div class="post_content"><div class="post_body user_formatted" dir="auto"><p>I just had to report somebody on game jolt for stealing your game I hope you do a offical version of this on game jolt</p></div><div class="post_footer"><a data-register_action="community_reply" class="post_action reply_btn" href="https://itch.io/login?intent=community&amp;return_to=https%3A%2F%2Faislebsoupid.itch.io%2Fbonnies-bakery">Reply</a></div></div></div></div><div id="post-7929919" class="community_post has_vote_column" data-post="{&quot;id&quot;:7929919,&quot;user_id&quot;:5442593}"><div class="post_grid"><div class="post_votes"><a data-register_action="community_vote" href="https://itch.io/login?intent=community&amp;return_to=https%3A%2F%2Faislebsoupid.itch.io%2Fbonnies-bakery" title="Vote up" class="vote_up_btn vote_btn"><svg width="20" class="svgicon icon_vote_up" role="img" height="20" version="1.1" viewbox="0 0 24 24" aria-hidden><polygon points="2 18 12 6 22 18" /></svg></a> <a data-register_action="community_vote" href="https://itch.io/login?intent=community&amp;return_to=https%3A%2F%2Faislebsoupid.itch.io%2Fbonnies-bakery" title="Vote down" class="vote_down_btn vote_btn"><svg width="20" class="svgicon icon_vote_down" role="img" height="20" version="1.1" viewbox="0 0 24 24" aria-hidden><polygon points="2 6 12 18 22 6" /></svg></a></div><a class="avatar_container" href="https://itch.io/profile/taluna"><div class="post_avatar" style="background-image: url(https://img.itch.zone/aW1nLzk3MTk2NDgucG5n/25x25%23/r2PNrN.png)"></div></a><div class="post_header"><span class="post_author"><a href="https://itch.io/profile/taluna">Taluna</a></span><span class="post_date" title="2023-06-08 15:05:16"><a href="https://itch.io/post/7929919">21 days ago</a></span> <span class="edit_message">(5 edits)</span> <span class="vote_counts"><span class="upvotes">(+2)</span></span></div><div class="post_content"><div class="post_body user_formatted" dir="auto"><p><strong>Bingus</strong><strong>!</strong></p>  <p>The Mix out of <strong>2D and 3D</strong> was a surprise, but <strong>well executed</strong>. I was just glad that it was not too difficult for me and therefore it was not frustrating at all. The lore telling was quite nice too.</p>  <h5><strong>Keep up the good work!</strong></h5>  <p>If you are interested on <strong>how to get all the endings</strong>, read ahead.</p>  <h4>- - - - - - - - - - Minor Spoiler - - - - - - - - -</h4>  <p>Sandtastesgreata commented on that already:</p>  <p>&quot;The <strong>different endings are tied to the score</strong> you get in the first half of the game! For the <strong>???</strong>&nbsp;though... let&#x27;s just say you&#x27;ll see something interesting when you<strong> pay extra attention to the other endings</strong>.&quot;</p>  <h4>- - - - - - - - - -&nbsp;All&nbsp;Endings - - - - - - - - - - -</h4>  <p><strong>Ending 1: Fresh Ingridients</strong> (let Bonnie catch you)</p>  <p><strong>Ending 2: Escape</strong> (score medium)</p>  <p><strong>Ending 3: Waiting</strong> (score high)</p>  <p><strong>Ending 4: Fear</strong> (score low, but not zero)</p>  <p><strong>Ending 5</strong>: <strong>Bingus</strong> score 0</p>  <p><strong>??? (Free)</strong>: You can get the secret code by watching all the endings in the right order. Pay attention on the lower left hand corner of the screen. Only in the fifth ending the number is on the lower right-hand corner hidden in the Bonnie-Animation.</p>  <p>The code would be: <strong>51322</strong></p></div><div class="post_footer"><a data-register_action="community_reply" class="post_action reply_btn" href="https://itch.io/login?intent=community&amp;return_to=https%3A%2F%2Faislebsoupid.itch.io%2Fbonnies-bakery">Reply</a></div></div></div></div><div id="post-7928429" class="community_post has_vote_column has_replies" data-post="{&quot;id&quot;:7928429,&quot;user_id&quot;:8236139}"><div class="post_grid"><div class="post_votes"><a data-register_action="community_vote" href="https://itch.io/login?intent=community&amp;return_to=https%3A%2F%2Faislebsoupid.itch.io%2Fbonnies-bakery" title="Vote up" class="vote_up_btn vote_btn"><svg width="20" class="svgicon icon_vote_up" role="img" height="20" version="1.1" viewbox="0 0 24 24" aria-hidden><polygon points="2 18 12 6 22 18" /></svg></a> <a data-register_action="community_vote" href="https://itch.io/login?intent=community&amp;return_to=https%3A%2F%2Faislebsoupid.itch.io%2Fbonnies-bakery" title="Vote down" class="vote_down_btn vote_btn"><svg width="20" class="svgicon icon_vote_down" role="img" height="20" version="1.1" viewbox="0 0 24 24" aria-hidden><polygon points="2 6 12 18 22 6" /></svg></a></div><a class="avatar_container" href="https://itch.io/profile/cdog123231"><div class="post_avatar" style="background-image: url(/static/images/frog-blue.png)"></div></a><div class="post_header"><span class="post_author"><a href="https://itch.io/profile/cdog123231">cdog123231</a></span><span class="post_date" title="2023-06-08 03:16:50"><a href="https://itch.io/post/7928429">22 days ago</a></span><span class="vote_counts"></span></div><div class="post_content"><div class="post_body user_formatted" dir="auto"><p>How do i move in the game i am playing it on mobile </p></div><div class="post_footer"><a data-register_action="community_reply" class="post_action reply_btn" href="https://itch.io/login?intent=community&amp;return_to=https%3A%2F%2Faislebsoupid.itch.io%2Fbonnies-bakery">Reply</a></div></div></div></div><div class="community_post_replies top_level_replie